import { useParams } from 'react-router-dom';
import users from './../../static/data/Data.js'

function App() {
  let { id } = useParams();
  const currentUser = users.hasOwnProperty(id);
  console.log('CURRENT USER', currentUser);
  console.log('USER', users);
  return (
    <div>ID: {id}</div>
  );
}

export default App;
